import React, { useContext, useEffect, useState } from 'react'
import mycontext from './Context/Createcontext'
function Selectdata() {
  const {Note, Getnotes}=useContext(mycontext)
 const[startMonth,SetstartMonth]=useState();
 const[startYear,setstartYear]=useState();
 const[EndMonth,SetendMonth]=useState();
 const[EndYear,setendYear]=useState();
  //Call Use Effect Hook To refresh The Data
  useEffect(()=>{
    Getnotes()
  },[])
  // Found Input Value
  const Startmonth=(e)=>{
SetstartMonth(e.target.value);};
const Startyear=(e)=>{setstartYear(e.target.value)}
const Endmonth=(e)=>{SetendMonth(e.target.value)};
const Endyear=(e)=>{setendYear(e.target.value)}
  
  return (
    <div>
      <div>
      <label for="month">Month:</label>
<select id="Smonth" name="StartM" value={startMonth} onChange={Startmonth}>
  <option value="01">January</option>
  <option value="02">February</option>
  <option value="03">March</option>
  <option value="04">April</option>
  <option value="05">May</option>
  <option value="06">June</option>
  <option value="07">July</option>
  <option value="08">August</option>
  <option value="09">September</option>
  <option value="10">October</option>
  <option value="11">November</option>
  <option value="12">December</option>
</select>

<label htmlFor="year">Year:</label>
      <select id="year" name="year" value={startYear} onChange={Startyear}>
        <option value="">Select a year</option>
        {/* Add your desired range of years as options */}
        {Array.from({ length: 10 }, (_, i) => (
          <option key={i} value={2022 + i}>{2022 + i}</option>
        ))}
      </select>
      </div>

      <div>
      <label for="month">Month:</label>
<select id="Emonth" name="EndM" value={EndMonth}onChange={Endmonth}>
  <option value="01">January</option>
  <option value="02">February</option>
  <option value="03">March</option>
  <option value="04">April</option>
  <option value="05">May</option>
  <option value="06">June</option>
  <option value="07">July</option>
  <option value="08">August</option>
  <option value="09">September</option>
  <option value="10">October</option>
  <option value="11">November</option>
  <option value="12">December</option>
</select>


<label htmlFor="year">Year:</label>
      <select id="year" name="year" value={EndYear} onChange={Endyear}>
        <option value="">Select a year</option>
        {/* Add your desired range of years as options */}
        {Array.from({ length: 10 }, (_, i) => (
          <option key={i} value={2022 + i}>{2022 + i}</option>
        ))}
      </select>
    </div>
    </div>
  )
}

export default Selectdata
